import * as React from 'react';
import { ClimbingBoxLoader } from 'react-spinners';

const Loader = props => {
  return (
    <div className="Loader">
      <ClimbingBoxLoader
        css={`
          display: block;
        `}
        sizeUnit={'px'}
        size={150}
        color={'#007fff'}
        {...props}
      />
    </div>
  );
};

export default Loader;
